(3, 'University Exam Batch - 2023', '<h3 style=\"text-align: center; z-index: 1; line-height: 45px; margin-right: 0px; margin-bottom: 10px;\"><b><u>ভার্সিটি \'ক\' + গুচ্ছ + কৃষি গুচ্ছ 3.0</u></b></h3><p class=\"nomar\" style=\"z-index: 1; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;\">HSC\'23 ব্যাচের জন্য ভার্সিটি প্রস্তুতির সবথেকে গোছানো এবং প্রাইভেট প্রোগ্রাম এটি। একটি প্রোগ্রামেই সম্পন্ন হবে DU,গুচ্ছ এবং কৃষি গুচ্ছের প্রস্তুতি। 1.0 তে ৬৯০ জন, 2.0 তে ১১০০+ জন শিক্ষার্থী DU তে চান্স পাবার পরে ৩য় বারের মত শুরু হচ্ছে প্রোগ্রামটি।</p>', 'https://www.bondipathshala.com.bd/course/du-allvarsity-3', NULL, 1, '2023-09-19 20:36:18', '2023-09-19 20:37:33');
